### JavaScript

```javascript
"use strict";

function f_gold(n, artifacts, dig) {
    function check(artifact) {
        let [r1, c1, r2, c2] = artifact;
        for (let x = r1; x <= r2; x++) {
            for (let y = c1; y <= c2; y++) {
                if (!s.has(`${x},${y}`)) {
                    return false;
                }
            }
        }
        return true;
    }
    let s = new Set(dig.map(([i, j]) => `${i},${j}`));
    return artifacts.reduce((acc, v) => acc + check(v), 0);
}
```
